import React, { lazy, Suspense } from 'react';
import { Spin } from 'antd';
import { Switch, Route, Redirect } from 'react-router-dom';
import AuthLayout from '../container/profile/authentication/Index';

const Login = lazy(() => import('../container/profile/authentication/overview/SignIn'));
const ForgotPass = lazy(() => import('../container/profile/authentication/overview/ForgotPassword'));

const NotFound = () => {
  return <Redirect to="/" />;
};

const FrontendRoutes = () => {
  return (
    <Switch>
      <Suspense
        fallback={
          <div className="spin">
            <Spin />
          </div>
        }
      >
        <Route exact path="/forgotPassword/:https://u25780944.ct.sendgrid.net/ls/click?upn=DjWP4id-2B3-2BoaecwgAbiZ3HvcgUK5s-2FW1vxsnk0EAsrj58eI41OmICfwqt-2B-2B6VHVsj3Jc8h0n3sMT9curlh-2B4FOqWcGhjpGKHlZ1YuqeCt1H-2B4KQMiPWPbWE1jfPoaFaQ4dqhvWIDPIywKI4NavEi1gAeHreLTjasgrBBx2cWxjLkaaYyppC9z3EVNY8iHC5QY-2FW-2Fcsygg85Tlf5ESjmSOSKei1U-2FNwaT7VO28sODBqlvoFVyRNccvn3Tpj3Z05TLYBfAzIzlhx8CHRoVjc1ahlIqoYVBgZsXaKe-2BqIj4-2FFer9PkYeQRyhhoIYMPsu9Sq1WLhwFGmPCV-2BmaAw-2BXQC-2B9FVMw4voiXJSltj1Ey3Trd6RV4EspZKoyp-2Fa5y0VPHyErkhhCu3hAg3gQPXUqQUs8fnyOPXidKmpk8cknBmT8g-3Dg3Fc_ytTeThUiOKJm6K-2BUWSI7gbQC8GptP78gzEQUcR-2BnSi8Oggo8ULsmZNhBUT2JNMkY2ErlnWg0UjbaFxg9OzaGyxcYW8EJH-2FNtPc7FjhgdtEF4JozAXwsSfTjGEVWcvwA0SBgaXHZO-2FQSrLkwC5y7V1P0PUd6VFnrOVGf655tsgmbQPeqFayCM5yJNrzsen8nQxv6r8YEb-2FOqRMU1PMOWnTA-3D-3D" component={ForgotPass} />
        <Route exact path="/" component={Login} />
        <Route exact path="*" component={NotFound} />
      </Suspense>
    </Switch>
  );
};

export default AuthLayout(FrontendRoutes);
